<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <meta name="apple-mobile-web-app-status-bar-style" content="black"/>
    <meta name="format-detection" content="telephone=no"/>
    <meta name="format-detection" content="email=no"/>
    <meta name="viewport"
          content="width=device-width,initial-scale=1,maximum-scale=1,minimum-scale=1,user-scalable=0"/>
    <title>!!!!</title>
    <style type="text/css">

        html, body {
          height: 100%;
        }
        body {
          display: -webkit-box;
          display: -webkit-flex;
          display: flex;
          padding: 0;
          margin: 0;
        }

        .am-page-result {
          -webkit-box-orient: vertical;
          -webkit-box-direction: normal;
          -webkit-flex-direction: column;
          flex-direction: column;
          -webkit-align-self: center;
          align-self: center;
          width: 100%;
        }

        .am-page-result {
        text-align: center;
        margin-bottom: 40px;
        }

        .am-page-result .am-page-result-pic {
        width: 135px;
        height: 135px;
        margin: 0 auto;
        }

        .am-page-result .am-page-result-pic img {
        width: 100%;
        height: 100%;
        }

        .am-page-result p {
        margin: 0;
        margin-bottom: 30px;
        font-size: 16px;
        color: #BBBBBB;
        }

        .am-page-result-button {
        margin-top: 15px;
        display: -webkit-box;
        display: -webkit-flex;
        display: flex;
        }

        .am-button {
        display: block;
        margin: 0 20px;
        padding: 0 10px;
        height: 42px;
        text-align: center;
        font-size: 18px;
        line-height: 42px;
        border-radius: 4px;
        outline: 0;
        -webkit-appearance: none;
        -webkit-box-flex: 1;
        -webkit-flex: 1;
        flex: 1;
        width: 50%;
        }

        .am-button[am-mode~=white] {
        border: 1px solid #DDDDDD;
        color: #FFFFFF;
        background-color: transparent;
        }

        .am-button[am-mode~=white]:active {
        border-color: #888888;
        background-color: #888888;
        }

        .am-button[am-mode~=blue] {
        border: 1px solid #28F;
        color: #FFF;
        background-color: #39F;
        }

        .am-button[am-mode~=blue]:active {
        border-color: #17F;
        background-color: #28F;
        }

        @media screen and (min-device-width: 375px) {
        .am-page-result .am-page-result-pic {
        width: 110px;
        height: 110px;
        }

        .am-page-result-button {
        margin-top: 15px;
        }

        .am-button {
        margin: 0 20px;
        height: 44px;
        line-height: 44px;
        }

        @media screen and (min-device-width: 414px) {
        .am-page-result .am-page-result-pic {
        width: 130px;
        height: 130px;
        }

        .am-button {
        margin: 0 40px;
        height: 50px;
        line-height: 50px;
        }
    </style>
